import { Fragment } from "react"

import Delicious from '../Assets/Delicious.jpg'
import classes from './'

const Header = () => {
    return(
        <Fragment>
            <h2>React Meals</h2>
            <h2>Your Cart</h2>
            <img src = {Delicious} alt="A table Full of Delicious Food"/>
        </Fragment>
    )
}
export default Header;
